import React from "react";
import { useState } from "react";

async function Test() {
  const [data, setData] = useState({});
  const datatemp = await fetch("https://fakestoreapi.com/products/1")
    .then((res) => res.json())
    .then((json) => console.log(json));
  return <div></div>;
}

export default async function Podaci() {
  return (
    <div>
      {datatemp.map((osoba) => {
        <p>kralj</p>;
      })}
    </div>
  );
}
